import React, { useContext } from 'react';
import AppContext from '../../AppContext';

class AppHeader extends React.Component {

  render() {
    return (
      <AppContext.Consumer>
        {({ application, setApplication }) => (
          <div><div>{application.id}</div></div>
        )}
      </AppContext.Consumer>
    );
  }
}

export default AppHeader;
